import httpService from './http-service'



class HumidityService {
  _getSeed(){
    return "seed"
  }
  getHumidity(){
    return httpService.get('http://90.50.57.123:3001/v1/humidity',{
      params: {
        seed: this._getSeed(),
      },
    })
  }
}


export default new HumidityService()
